<!DOCTYPE html>
<html lang="zh-CN">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>八年级学生名单查询</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: "Microsoft YaHei", sans-serif;
        }
        /* 深色背景：衬托玻璃窗口 */
        body {
            background: #1a1c23;
            padding: 40px 20px;
            min-height: 100vh;
            overflow: hidden;
            background-image: radial-gradient(rgba(255,255,255,0.05) 1px, transparent 1px);
            background-size: 20px 20px;
        }
        /* 玻璃窗口主体 */
        .glass-window {
            max-width: 850px;
            margin: 0 auto;
            background: rgba(255, 255, 255, 0.08);
            backdrop-filter: blur(18px);
            -webkit-backdrop-filter: blur(18px);
            box-shadow: 0 8px 32px rgba(0, 0, 0, 0.3), inset 0 0 0 1px rgba(255, 255, 255, 0.1);
            border-radius: 24px;
            padding: 25px;
            height: calc(100vh - 80px);
            display: flex;
            flex-direction: column;
        }
        /* 头部标题区 */
        .header {
            padding-bottom: 20px;
            border-bottom: 1px solid rgba(255, 255, 255, 0.1);
            margin-bottom: 25px;
        }
        .header h1 {
            font-size: 1.6em;
            color: #ffffff;
            margin-bottom: 8px;
        }
        .header p {
            font-size: 0.9em;
            color: rgba(255, 255, 255, 0.7);
        }
        /* 查询筛选区 */
        .search-section {
            margin-bottom: 25px;
        }
        .filter-group {
            display: flex;
            gap: 20px;
            flex-wrap: wrap;
            margin-bottom: 22px;
        }
        .filter-item {
            flex: 1;
            min-width: 220px;
        }
        .filter-item label {
            display: block;
            margin-bottom: 8px;
            font-size: 0.9em;
            color: rgba(255, 255, 255, 0.7);
        }
        .filter-item select, .filter-item input {
            width: 100%;
            padding: 12px 16px;
            background: rgba(255, 255, 255, 0.1);
            border: 1px solid rgba(255, 255, 255, 0.2);
            border-radius: 12px;
            font-size: 0.95em;
            color: #ffffff;
            outline: none;
            transition: all 0.2s;
        }
        .filter-item select:focus, .filter-item input:focus {
            border-color: #4cc9f0;
            box-shadow: 0 0 0 2px rgba(76, 201, 240, 0.2);
        }
        .filter-item select option {
            background: #1a1c23;
            color: #ffffff;
        }
        .btn-wrap {
            display: flex;
            gap: 15px;
        }
        .search-btn, .reset-btn {
            padding: 12px 26px;
            border-radius: 12px;
            font-size: 0.95em;
            cursor: pointer;
            border: none;
            transition: all 0.2s;
            font-weight: 500;
        }
        .search-btn {
            background: #4cc9f0;
            color: #1a1c23;
        }
        .search-btn:hover {
            background: #43b6d9;
            box-shadow: 0 4px 12px rgba(76, 201, 240, 0.3);
        }
        .reset-btn {
            background: rgba(255, 255, 255, 0.1);
            color: rgba(255, 255, 255, 0.9);
            border: 1px solid rgba(255, 255, 255, 0.2);
        }
        .reset-btn:hover {
            background: rgba(255, 255, 255, 0.15);
        }
        /* 结果滚动区：修复重叠的关键容器 */
        .result-section {
            flex: 1;
            overflow-y: auto;
            overflow-x: hidden;
            border-radius: 16px;
            background: rgba(255, 255, 255, 0.05);
            padding: 20px;
        }
        .result-section::-webkit-scrollbar {
            width: 8px;
        }
        .result-section::-webkit-scrollbar-track {
            background: rgba(255, 255, 255, 0.05);
            border-radius: 4px;
        }
        .result-section::-webkit-scrollbar-thumb {
            background: rgba(255, 255, 255, 0.2);
            border-radius: 4px;
        }
        .result-header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 20px;
            color: #ffffff;
        }
        .result-header h2 {
            font-size: 1.1em;
            font-weight: 500;
        }
        .result-count {
            font-size: 0.85em;
            color: rgba(255, 255, 255, 0.7);
        }
        /* 表格：修复重叠+表头高不透明度 */
        .student-table {
            width: 100%;
            border-collapse: separate; /* 圆角生效前提 */
            border-spacing: 0; /* 清除单元格间距 */
            font-size: 0.9em;
            table-layout: fixed;
        }
        /* 表头：提高不透明度（0.2→0.3）+ 加z-index和边框隔离 */
        .student-table th {
            padding: 14px 16px;
            text-align: left;
            /* 提高不透明度，更清晰，保留玻璃感 */
            background: rgba(255, 255, 255, 0.3);
            backdrop-filter: blur(10px);
            -webkit-backdrop-filter: blur(10px);
            color: #1a1c23; /* 深色文字，与高透明白背景对比更清晰 */
            font-weight: 500;
            position: sticky;
            top: 0;
            z-index: 100; /* 提高z-index，避免被内容覆盖 */
            border-bottom: 2px solid rgba(255, 255, 255, 0.2); /* 加粗下边框，物理隔离内容 */
        }
        /* 表头圆角 */
        .student-table th:first-child {
            border-top-left-radius: 12px;
        }
        .student-table th:last-child {
            border-top-right-radius: 12px;
        }
        /* 表格内容：加顶部内边距，避免紧贴表头 */
        .student-table td {
            padding: 14px 16px;
            text-align: left;
            color: rgba(255, 255, 255, 0.8);
            border-bottom: 1px solid rgba(255, 255, 255, 0.05);
            /* 额外加顶部间距，彻底解决重叠 */
            margin-top: 4px;
        }
        /* 行hover效果：不影响表头 */
        .student-table tbody tr:hover {
            background: rgba(255, 255, 255, 0.08);
        }
        .empty-tip {
            text-align: center;
            padding: 70px 0;
            color: rgba(255, 255, 255, 0.5);
            font-size: 0.95em;
        }
        /* 底部提示 */
        .footer {
            padding-top: 20px;
            margin-top: 25px;
            border-top: 1px solid rgba(255, 255, 255, 0.1);
            text-align: center;
            font-size: 0.85em;
            color: rgba(255, 255, 255, 0.5);
        }
    </style>
</head>
<body>
    <div class="glass-window">
        <div class="header">
            <h1>八年级学生名单查询系统</h1>
            <p>液态玻璃窗口 · 表头优化版</p>
        </div>

        <div class="search-section">
            <div class="filter-group">
                <div class="filter-item">

                        <option value="八年级 15班">八年级 15班</option>
                        <option value="八年级 16班">八年级 16班</option>
                        <option value="八年级 17班">八年级 17班</option>
                        <option value="八年级 18班">八年级 18班</option>
                        <option value="八年级 19班">八年级 19班</option>
                        <option value="八年级 20班">八年级 20班</option>
                        <option value="八年级 21班">八年级 21班</option>
                        <option value="八年级 22班">八年级 22班</option>
                        <option value="八年级 23班">八年级 23班</option>
                        <option value="八年级 24班">八年级 24班</option>
                        <option value="八年级 25班">八年级 25班</option>
                        <option value="八年级 26班">八年级 26班</option>
                    </select>
                </div>
                <div class="filter-item">
                    <label for="genderSelect">选择性别</label>
                    <select id="genderSelect">
                        <option value="">全部性别</option>
                        <option value="男">男</option>
                        <option value="女">女</option>
                    </select>
                </div>
                <div class="filter-item">
                    <label for="nameInput">姓名关键词</label>
                    <input type="text" id="nameInput" placeholder="输入姓名中的字，如“李”">
                </div>
            </div>
            <div class="btn-wrap">
                <button class="search-btn" id="searchBtn">执行查询</button>
                <button class="reset-btn" id="resetBtn">重置筛选</button>
            </div>
        </div>

        <div class="result-section">
            <div class="result-header">
                <h2>查询结果列表</h2>
                <div class="result-count">匹配到 <span id="matchCount">0</span> 条记录</div>
            </div>
            <!-- 修复表头标签错误：之前多了一个<符号 -->
            <table class="student-table">
                <thead>
                    <tr>
                        <th>年级班级</</th>
                        <th>学生姓名</</th>
                        <th>性别</</th>
                    </tr>
                </thead>
                <tbody id="resultTableBody">
                    <tr class="empty-tip">
                        <td colspan="3">请设置筛选条件并点击“执行查询”</td>
                    </tr>
                </tbody>
            </table>
        </div>

        <div class="footer">
            操作提示：加密数据需填入JS代码指定位置，查询时仅在本地查询
        </div>
    </div>

        const classSelect = document.getElementById('classSelect');
        const genderSelect = document.getElementById('genderSelect');
        const nameInput = document.getElementById('nameInput');
        const searchBtn = document.getElementById('searchBtn');
        const resetBtn = document.getElementById('resetBtn');
        const resultTableBody = document.getElementById('resultTableBody');
        const matchCount = document.getElementById('matchCount');

        let studentList = [];
        try {
            if (YOUR_BASE64_ENCRYPTED_DATA.trim()) {
                const decryptedStr = decodeURIComponent(atob(YOUR_BASE64_ENCRYPTED_DATA));
                studentList = JSON.parse(decryptedStr);
            }
        } catch (err) {
            alert('加密数据格式错误！请检查Base64串是否正确');
        }

        searchBtn.addEventListener('click', () => {
            const selectedClass = classSelect.value;
            const selectedGender = genderSelect.value;
            const nameKeyword = nameInput.value.trim().toLowerCase();

            // 模拟60条数据，方便测试滚动和表头重叠问题
            const mockData = Array.from({length: 60}, (_, i) => ({
                gradeClass: `八年级 ${(i%7)+1}班`,
                name: `学生${i+1}`,
                gender: i%2 === 0? '男' : '女'
            }));
            const useData = studentList.length? studentList : mockData;

            const filteredStudents = useData.filter(student => {
                const classMatch =!selectedClass || student.gradeClass === selectedClass;
                const genderMatch =!selectedGender || student.gender === selectedGender;
                const nameMatch =!nameKeyword || student.name.toLowerCase().includes(nameKeyword);
                return classMatch && genderMatch && nameMatch;
            });

            renderResult(filteredStudents);
        });

        resetBtn.addEventListener('click', () => {
            classSelect.value = "";
            genderSelect.value = "";
            nameInput.value = "";
            resultTableBody.innerHTML = `
                <tr class="empty-tip">
                    <td colspan="3">请设置筛选条件并点击“执行查询”</td>
                </tr>
            `;
            matchCount.textContent = "0";
        });

        function renderResult(students) {
            matchCount.textContent = students.length;
            if (students.length === 0) {
                resultTableBody.innerHTML = `
                    <tr class="empty-tip">
                        <td colspan="3">未找到匹配的学生记录，请调整筛选条件</td>
                    </tr>
                `;
                return;
            }

            let tableHtml = "";
            students.forEach(student => {
                tableHtml += `
                    <tr>
                        <td>${student.gradeClass}</td>
                        <td>${student.name}</td>
                        <td>${student.gender}</td>
                    </tr>
                `;
            });
            resultTableBody.innerHTML = tableHtml;
        }
